    "2015-11-18T09:34:27.673008",nt"name": "u-s-forest-service-land-units",nt"isopen":
    true,nt"url": null,nt"notes": "A map service on the www depicting National
    Forest Service land units. An NFS Land Unit is nationally significant classification
    of Federally owned forest, range, and related lands that are administered by the
    USDA Forest Service or designated for administration through the Forest Service.
    NFS Land Unit types include proclaimed national forest, purchase unit, national
    grassland, land utilization project, research and experimental area, national preserve,
    and other land area. Each NFS Land Unit is identified by a National Forest Fiscal
    Identifier (NFFID) code, a unique 4-digit number that is used for accounting purposes.
    The purpose of the map is to provide display, identification, and analysis tools
    for determining current boundary information for Forest Service managers, GIS Specialists,
